import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import './App';
import "./index.css";
import Sdata from "./Sdata";

// console.log(Sdata[0].sname);
// function ncard(val){
//   console.log(val);

// }

ReactDOM.render(
  <>
  <h1 className="heading_style">List Of Top 8 Netflix Series in 2021</h1>

  {Sdata.map(function ncard(val){
    return(
      <Card 
      imgsrc={val.imgsrc}
      title={val.title}
      sname={val.sname}
      link={val.link} 
      />
    );

  })}
  </>,
  document.getElementById('root')
);
